INSERT INTO `boxes` VALUES (1,'Our leadership team has championed product strategy and engineering at top-tier companies like Amazon and Oracle Corporation. Having bootstrapped and successfully exited high-technology startups, we understand that execution is key no matter how novel an idea. We know the art of balancing product scope, quality and time to market and have studied at premier schools - Stanford University, IIT Bombay and UCSB.','Leadership',2),(2,' Each of our client engagement is managed and executed by one of our partners. Our company DNA places our clients interests before ours. We offer flexible engagement models – use us to prototype concepts, outsource entire project research and development or augment your engineering team.','Commitment',2),(3,'  We can work on most Operating systems, Programming Languages, databases and technologies. While we have our biases, will learn new frameworks if needed.<br />\r\n............................................................................<br />\r\n<strong>Web Products</strong> <br />\r\nSaaS, web2.0, online video, Social Apps<br />\r\n<strong>Distributed Systems</strong> <br />\r\nCloud computing, Web Services, Internet scale problems<br />\r\n<strong>Business Intelligence</strong> <br />\r\n\r\nReporting, Data Warehousing, Analytics<br />\r\n\r\n<strong>Maintaining and enhancing legacy \r\napplications</strong><br />\r\n............................................................................','Depth in expertise',2),(4,'<img src=\"http://clearsenses.com/imgs/team.gif\" alt=\"team\" /><br />\r\n<br />\r\n<strong>Sanjay Suri – Founder, Ceo</strong><br />\r\nSanjay is a startup veteran who started his career at Oracle Corporation in Redwood Shores working in the Server Technologies group. He worked on extensions to Oracle 8i transaction layer and also architected the integration of OLAP option to Oracle 10g. Later at Amazon.com he led product development for the Risk and Fraud sub-system of Amazon’s Payment Webservice – Flexible Payment Service.<br />\r\n<br />\r\nSanjay has been associated with multiple startups. Right after working at Oracle, he co-founded Trivium Systems in India and led product development for the flagship CRM product – SimpleRM that was sold to Infosys. In 2007, Sanjay started an online video portal - videocrux.com - and sold it after a launching private beta.<br />\r\n<br />\r\nSanjay has an MS(CS) University of California, Santa Barbara; MS (CS) from University of Poona and BA (Math) from St. Stephen\'s college, Delhi University.<br />\r\n<br />\r\n\r\n<a href=\"http://www.linkedin.com/in/sanjaysuri\"><img src=\"http://clearsenses.com/imgs/sanjay_in.gif\" alt=\"linked in\" width=\"139\" height=\"33\" /></a><br />\r\n<br />','sanjay block',2),(5,'<strong>Sandeep Srinivasa – Partner </strong>\r\n<br />\r\nSandeep has most recently worked as a Software Architect for Adaptiva and has been involved in deployment at Fortune 500 companies. Previously, he has been Senior Member of Technical Staff for EDA software startup - Calypto - for its Powerpro® software. He has also been the technology lead for Atrenta Constraints® chip-design software and involved in its deployment at TI, ST and Nokia.Sandeep holds a B.Tech from IIT Bombay and  MS in Embedded systems from ALARI –Switzerland. <br />\r\n<br />\r\n<a href=\"http://www.linkedin.com/in/sandeepss\"><img src=\"http://clearsenses.com/imgs/sandeep_on.gif\" alt=\"sandeep\" width=\"149\" height=\"33\" /></a>','sandeep block',2),(6,'<img src=\"http://clearsenses.com/imgs/contact_us.gif\"/></br>\r\n<table width=\"100%\" border=\"0\" cellspacing=\"0\" cellpadding=\"2\">\r\n  <tr>\r\n    <td>Call Sanjay at : +9199102 66626 <br />\r\n      or drop us a note at <a href=\"mailto:hi@clearsenses.com\">hi@clearsenses.com</a> &nbsp;&nbsp;&nbsp;</td>\r\n\r\n    <td>Clearsenses Technologies<br />\r\n      B1 Sector 57, Noida, UP 201301, India</td>\r\n  </tr>\r\n  <tr>\r\n    <td></td>\r\n    <td></td>\r\n  </tr>\r\n</table>\r\n\r\n<br />\r\n<br />\r\nFor directions, refer to the map below.','contact',2);
