INSERT INTO `cache_filter` VALUES ('2:c3f25810029030174c7f3863e2957d4f','<p>Our leadership team has championed product strategy and engineering at top-tier companies like Amazon and Oracle Corporation. Having bootstrapped and successfully exited high-technology startups, we understand that execution is key no matter how novel an idea. We know the art of balancing product scope, quality and time to market and have studied at premier schools - Stanford University, IIT Bombay and UCSB.</p>\n',1307189325,1307102925,'',0),('2:2fcbd166dd7a6f28d7a47da396b8e57a','<p> Each of our client engagement is managed and executed by one of our partners. Our company DNA places our clients interests before ours. We offer flexible engagement models – use us to prototype concepts, outsource entire project research and development or augment your engineering team.</p>\n',1307189325,1307102925,'',0),('2:a894a54ba8befdc7f717bc3a9555147c','<p>  We can work on most Operating systems, Programming Languages, databases and technologies. While we have our biases, will learn new frameworks if needed.<br />\n............................................................................<br />\n<strong>Web Products</strong> <br />\nSaaS, web2.0, online video, Social Apps<br />\n<strong>Distributed Systems</strong> <br />\nCloud computing, Web Services, Internet scale problems<br />\n<strong>Business Intelligence</strong> </p>\n<p>Reporting, Data Warehousing, Analytics</p>\n<p><strong>Maintaining and enhancing legacy<br />\napplications</strong><br />\n............................................................................</p>\n',1307189325,1307102925,'',0),('2:da5f72a1a925f419fd8a5c08cc590fe2','<table width=\"100%\" border=\"0\" cellspacing=\"0\" cellpadding=\"2\">\n<tr>\n<td>Call Sanjay at : +9199102 66626 <br />\n      or drop us a note at <a href=\"mailto:hi@clearsenses.com\">hi@clearsenses.com</a> &nbsp;&nbsp;&nbsp;</td>\n<td>Clearsenses Technologies<br />\n      B1 Sector 57, Noida, UP 201301, India</td>\n</tr>\n<tr>\n<td></td>\n<td></td>\n</tr>\n</table>\n<p>For directions, refer to the map below.</p>\n',1307189326,1307102926,'',0),('2:f638a80e06442f78ea4defdc74526e44','<p><img src=\"http://clearsenses.com/imgs/team.gif\" alt=\"team\" /></p>\n<p><strong>Sanjay Suri – Founder, Ceo</strong><br />\nSanjay is a startup veteran who started his career at Oracle Corporation in Redwood Shores working in the Server Technologies group. He worked on extensions to Oracle 8i transaction layer and also architected the integration of OLAP option to Oracle 10g. Later at Amazon.com he led product development for the Risk and Fraud sub-system of Amazon’s Payment Webservice – Flexible Payment Service.</p>\n<p>Sanjay has been associated with multiple startups. Right after working at Oracle, he co-founded Trivium Systems in India and led product development for the flagship CRM product – SimpleRM that was sold to Infosys. In 2007, Sanjay started an online video portal - videocrux.com - and sold it after a launching private beta.</p>\n<p>Sanjay has an MS(CS) University of California, Santa Barbara; MS (CS) from University of Poona and BA (Math) from St. Stephen\'s college, Delhi University.</p>\n<p><a href=\"http://www.linkedin.com/in/sanjaysuri\"><img src=\"http://clearsenses.com/imgs/sanjay_in.gif\" alt=\"linked in\" width=\"139\" height=\"33\" /></a></p>\n',1307189327,1307102927,'',0),('2:6d9a5d1b0b2f7b77fd941bdcdb705e94','<p><strong>Sandeep Srinivasa – Partner </strong><br />\n<br />\nSandeep has most recently worked as a Software Architect for Adaptiva and has been involved in deployment at Fortune 500 companies. Previously, he has been Senior Member of Technical Staff for EDA software startup - Calypto - for its Powerpro® software. He has also been the technology lead for Atrenta Constraints® chip-design software and involved in its deployment at TI, ST and Nokia.Sandeep holds a B.Tech from IIT Bombay and  MS in Embedded systems from ALARI –Switzerland. </p>\n<p><a href=\"http://www.linkedin.com/in/sandeepss\"><img src=\"http://clearsenses.com/imgs/sandeep_on.gif\" alt=\"sandeep\" width=\"149\" height=\"33\" /></a></p>\n',1307189327,1307102927,'',0),('2:80b9de2a28a3ae0865e12076dbf0b5e3','<p><img src=\"http://clearsenses.com/imgs/contact_us.gif\" /></p>\n<table width=\"100%\" border=\"0\" cellspacing=\"0\" cellpadding=\"2\">\n<tr>\n<td>Call Sanjay at : +9199102 66626 <br />\n      or drop us a note at <a href=\"mailto:hi@clearsenses.com\">hi@clearsenses.com</a> &nbsp;&nbsp;&nbsp;</td>\n<td>Clearsenses Technologies<br />\n      B1 Sector 57, Noida, UP 201301, India</td>\n</tr>\n<tr>\n<td></td>\n<td></td>\n</tr>\n</table>\n<p>For directions, refer to the map below.</p>\n',1307189954,1307103554,'',0);
